function (doc,req) {

		// Returns a subset of _design/photon
		// with userCtx attached as ._me

		var that = this,
				cut = {
					shows:1, lists:1, updates:1, rewrites:1, views:1, 
					api:1, hooks:1, validate_doc_update:1, _module_cache:1
				},
				obj = {
					_me: {name: req.userCtx.name,  roles: req.userCtx.roles},
					_peer: req.peer
				};

		Object.keys(that).forEach(function(i){if (!cut[i]) obj[i] = that[i]});

		return {json:obj};
	}

